import React from 'react';
import { useSelector, useDispatch } from 'react-redux'
import { Menu, Row, Col } from 'antd';
import { LoginOutlined, UnorderedListOutlined, CloudOutlined, DollarCircleOutlined } from '@ant-design/icons';
import { useNavigate } from 'react-router-dom';
import { routeNames } from '../../router';

const Navbar = () => {
    const navigate = useNavigate();
    const dispatch = useDispatch();
    const { isAuth } = useSelector(state => state.isAuth);

    return (
        <Row justify="end">
                {isAuth
                    ?
                    <Menu mode="horizontal" selectable={false}>
                        <Menu.Item onClick={() => navigate(routeNames.HOMEPAGE)} key="main" icon={<UnorderedListOutlined />}>
                            Main
                        </Menu.Item>
                        <Menu.Item onClick={() => navigate(routeNames.WEATHER)} key="weather" icon={<CloudOutlined />}>
                            Weather
                        </Menu.Item>
                        <Menu.Item onClick={() => navigate(routeNames.CURRENCY)} key="currency" icon={<DollarCircleOutlined />}>
                            Currency
                        </Menu.Item>
                        <Menu.Item
                            onClick={() => {
                                dispatch({ type: 'SET_AUTH', payload: false });
                                navigate(routeNames.LOGIN);
                            }}
                            key="logout"
                            icon={<LoginOutlined />}
                        >
                            Log out
                        </Menu.Item>
                    </Menu>
                    :
                    <Col span={3}>
                        <Menu mode="horizontal" selectable={false} style={{ justifyContent: 'flex-end' }}>
                            <Menu.Item
                                onClick={() => {
                                    dispatch({ type: 'SET_AUTH', payload: true });
                                    navigate(routeNames.HOMEPAGE);
                                }}
                                key="login"
                                icon={<LoginOutlined />}
                            >
                                Login
                            </Menu.Item>
                        </Menu>
                    </Col>
                }
        </Row>
    );
};

export default Navbar;
